import './App.css';
import React from 'react';

const todos = [
    {text: 'Hablar con Ana', completed: false},
    {text: 'Regañar a Ana', completed: false},
    {text: 'Nalguear a Ana', completed: false}
]

function App() {
  return (
    <React.Fragment>
      <TodoCounter/>
        <h2>Has completado 2 de 3 TODOs</h2>
      <TodoSearch/>
        <input placeholder="Hola" type="text"/>
      <TodoList>
        {todos.map(todo => (
          <TodoItem/>
        ))}
      </TodoList>
      <CreateTodoButtom/>
        <button></button>
    </React.Fragment>
  );
}

export default App;
